            "Conceptos básicos, Para los fines y efectos de la presente Ley, ténganse como ",
            "conceptos básicos los siguientes:",
            "1) Accidente de tránsito: Acción u omisión culposa cometida por cualquier conduct" +
                "or,",
            "pasajero o peatón en la vía pública o privada causando daños materiales, lesiones" +
                " o ",
            "muerte de personas, donde interviene por los menos un vehículo en movimiento.",
            "2) Aventajamiento: Acción y efecto de aventajar un vehículo a otro sobre la march" +
                "a. ",
            "3) Acera o anden: Es la parte superior de la vía pública destinada únicamente par" +
                "a la ",
            "circulación peatonal. ",
            "4) Agente de tránsito: Es el oficial de la Policía Nacional encargado ",
            "de aplicar la Ley para el Régimen de Circulación Vehicular e Infracciones de Trán" +
                "sito, así ",
            "como las demás disposiciones administrativas relativas a la materia. ",
            "5) Arcén: Franja longitudinal afirmada contiguo a la calzada, que no está destina" +
                "da al ",
            "uso de vehículos automotor, salvo circunstancias excepcionales. ",
            "6) Ángulo de visibilidad: Es el área máxima de visión que debe de tener todo cond" +
                "uctor",
            "al desplazarse sobre la vía.",
            "7) Boleta de infracción: Formulario mediante el cual se aplica una o más infracci" +
                "ones de tránsito",
            "a cualquier conductor, para que éste pague el valor de la misma en moneda de curs" +
                "o legal, por",
            "incurrir en la violación a la Ley de la materia.",
            "8) Calzada: Es el área de la vía destinada únicamente para la circulación de vehí" +
                "culos:",
            "automotor, de pedal o de tracción animal.",
            "8) Calcomanía: Imagen que, mediante la aplicación de agua o calor, se transfiere " +
                "del soporte",
            "original a otra superficie donde queda adherida; también se le podrían definir as" +
                "í a las pegatinas",
            "o figuras autoadhesivas que no requieren el uso de agua.",
            "8) Calcomanía de revisado: La que se emite a los propietarios de vehículos con mo" +
                "tor de",
            "combustión interna, eléctrico o híbrido que han aprobado satisfactoriamente la co" +
                "mprobación",
            "o verificación de los requisitos y obligaciones a los que hace referencia la pres" +
                "ente Ley."});
